import Cards from "../../components/cards/cards";
import cardImg from "../../img/1.jpg";
import cardImg1 from "../../img/4.jpg";
import cardImg2 from "../../img/7.jpg";
import cardImg3 from "../../img/9.jpg";
import "./corevalues.css";

export default function coreValues(){
    return(
        <div className="corevalue">
            <div className="coreCards">
                <div className="coreLeft">
                   <div className="coreFleft"> 
                    <Cards  cardTitle="Freedom" cardImg={cardImg} cardDetail="dfb hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj"/>
                    </div>
                   <div className="coreFright"> 
                    <Cards  cardTitle="Creativity" cardImg={cardImg1} cardDetail="dfb hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj"/>
                   </div> 
                </div>
                <div className="coreRight">
                   <div className="coreFleft"> 
                    <Cards  cardTitle="Emotional Intelligence" cardImg={cardImg2} cardDetail="dfb hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj"/>
                   </div>
                   <div className="coreFright"> 
                    <Cards  cardTitle="Self Awareness" cardImg={cardImg3} cardDetail="dfb hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj"/>
                   </div> 
                </div>
            </div>
        </div>
    );
}
